import React, { useState } from 'react';

const CricketPage = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalImageSrc, setModalImageSrc] = useState('');
  const [currentIndex, setCurrentIndex] = useState(0);

  const images = [
    "/images/Cricket.jpg",
    "/images/Cricket.jpg",
    "/images/Cricket.jpg"
  ];

  const openModal = (index) => {
    setModalImageSrc(images[index]);
    setCurrentIndex(index);
    setIsModalOpen(true);
  };

  const closeModal = () => setIsModalOpen(false);

  const nextImage = () => {
    const nextIndex = (currentIndex + 1) % images.length;
    setModalImageSrc(images[nextIndex]);
    setCurrentIndex(nextIndex);
  };

  const prevImage = () => {
    const prevIndex = (currentIndex - 1 + images.length) % images.length;
    setModalImageSrc(images[prevIndex]);
    setCurrentIndex(prevIndex);
  };

  return (
    <div style={{ 
      backgroundColor: 'black', 
      color: 'white', 
      minHeight: '100vh', 
      padding: '20px',
      display: 'flex',
      flexDirection: 'column',
    }}>
      <div style={{ 
        width: '100%', 
        boxSizing: 'border-box', 
        padding: '20px',
        marginBottom: '20px', 
      }}>
        <h1 style={{ fontSize: '2.5rem' }}>Cricket</h1>
        <p style={{ fontSize: '1.25rem' }}>
          <img 
            src="/images/Cricket.jpg" 
            alt="Cricket" 
            width="500px" 
            height="340px" 
            style={{ 
              float: 'right', 
              border: '2px dotted black', 
              margin: '0 25px 15px 0',
              cursor: 'pointer' 
            }} 
            onClick={() => openModal(0)} 
          />
          Image description for Cricket1.
        </p>
      </div>
      <div style={{ 
        width: '100%', 
        boxSizing: 'border-box', 
        padding: '20px',
        marginBottom: '20px', 
      }}>
        <h1 style={{ fontSize: '2.5rem' }}>Cricket</h1>
        <p style={{ fontSize: '1.25rem' }}>
          <img 
            src="/images/Cricket.jpg" 
            alt="Cricket" 
            width="500px" 
            height="340px" 
            style={{ 
              float: 'left', 
              border: '2px dotted black', 
              margin: '0 25px 15px 0',
              cursor: 'pointer' 
            }} 
            onClick={() => openModal(1)} 
          />
          Image description for Cricket2.
        </p>
      </div>
      <div style={{ 
        width: '100%', 
        boxSizing: 'border-box', 
        padding: '20px',
      }}>
        <h1 style={{ fontSize: '2.5rem' }}>Cricket</h1>
        <p style={{ fontSize: '1.25rem' }}>
          <img 
            src="/images/Cricket.jpg" 
            alt="Cricket" 
            width="500px" 
            height="340px" 
            style={{ 
              float: 'right', 
              border: '2px dotted black', 
              margin: '0 25px 15px 0',
              cursor: 'pointer' 
            }} 
            onClick={() => openModal(2)} 
          />
          Image description for Cricket3.
        </p>
      </div>

      {/* Modal */}
      {isModalOpen && (
        <div style={{ 
          position: 'fixed', 
          top: 0, 
          left: 0, 
          width: '100%', 
          height: '100%', 
          backgroundColor: 'rgba(0, 0, 0, 0.8)', 
          display: 'flex', 
          justifyContent: 'center', 
          alignItems: 'center',
          zIndex: 1000,
        }} onClick={closeModal}>
          <div style={{ 
            position: 'relative',
            maxWidth: '90%', 
            maxHeight: '80%',
          }}>
            <img 
              src={modalImageSrc} 
              alt="Cricket" 
              style={{ 
                width: '100%', 
                height: 'auto',
                cursor: 'pointer'
              }} 
              onClick={(e) => e.stopPropagation()} // Prevent closing the modal when clicking on the image
            />
            <button 
              onClick={prevImage} 
              style={{ 
                position: 'absolute', 
                top: '50%', 
                left: '10px', 
                transform: 'translateY(-50%)', 
                backgroundColor: 'rgba(255, 255, 255, 0.7)', 
                border: 'none', 
                padding: '10px', 
                cursor: 'pointer'
              }}
            >
              &#9664; {/* Left arrow */}
            </button>
            <button 
              onClick={nextImage} 
              style={{ 
                position: 'absolute', 
                top: '50%', 
                right: '10px', 
                transform: 'translateY(-50%)', 
                backgroundColor: 'rgba(255, 255, 255, 0.7)', 
                border: 'none', 
                padding: '10px', 
                cursor: 'pointer'
              }}
            >
              &#9654; {/* Right arrow */}
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default CricketPage;
